class EyeCatalog {

    private static _instance: EyeCatalog;

    swatches = [
        new Swatch(EyeType.Eye1, "Vulcan Eyes", (token) => EyeCatalog.decorateSwatch(Eye1, token)),
        new Swatch(EyeType.Eye2, "Standard Brow", (token) => EyeCatalog.decorateSwatch(Eye2, token)),
        new Swatch(EyeType.Eye3, "Thin Brow, Narrower Eyes", (token) => EyeCatalog.decorateSwatch(Eye3, token)),
        new Swatch(EyeType.Eye4, "Thin Brow, Wider Eyes", (token) => EyeCatalog.decorateSwatch(Eye4, token)),
        new Swatch(EyeType.Eye5, "Heavy Brow", (token) => EyeCatalog.decorateSwatch(Eye5, token)),
        new Swatch(EyeType.Eye6, "Older", (token) => EyeCatalog.decorateSwatch(Eye6, token)),
    ];

    public static get instance() {
        if (EyeCatalog._instance == null) {
            EyeCatalog._instance = new EyeCatalog();
        }
        return EyeCatalog._instance;
    }

    getEyes(token: Token) {
        let result = Eye1;
        if (token.eyeType === EyeType.Eye2) {
            result = Eye2;
        } else if (token.eyeType === EyeType.Eye3) {
            result = Eye3;
        } else if (token.eyeType === EyeType.Eye4) {
            result = Eye4;
        } else if (token.eyeType === EyeType.Eye5) {
            result = Eye5;
        } else if (token.eyeType === EyeType.Eye6) {
            result = Eye6;
        }
        return result.replace(/#756860/g, token.eyeColor);
    }

    private static decorateSwatch(svg: string, token: Token) {
        let result = `<svg viewBox="0 0 110 110" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <g transform="translate(-250, -75)">`
                + svg.replace(/#756860/g, token.eyeColor)
            + `</g>
            </svg>`;
        return result;
    }
}

export default EyeCatalog;